import{_ as e,a as t,o as a,H as n}from"./chunks/framework.Cao6T-Ti.js";const u=JSON.parse('{"title":"OOLEY42 на квест-пикнике фестиваля Планета людей в Музеоне","description":"","frontmatter":{"title":"OOLEY42 на квест-пикнике фестиваля Планета людей в Музеоне","date":"2015-07-13","cover":"d75cf0e5e1eecad0bc814e9687f6491b.jpg","youtube":"https://youtu.be/atD0BxiSods"},"headers":[],"relativePath":"practice/event/ooley42-na-kvest-piknike-festivalya-planeta-lyudej-v-muzeone/index.md","filePath":"practice/event/ooley42-na-kvest-piknike-festivalya-planeta-lyudej-v-muzeone/index.md"}'),r={name:"practice/event/ooley42-na-kvest-piknike-festivalya-planeta-lyudej-v-muzeone/index.md"},o=n('<p>В московском парке <a href="http://www.muzeon.ru/" class="external-link" target="_blank" rel="noreferrer">Музеон</a> <strong>30 июля</strong> откроется фестиваль, организованный телеканалом Моя планета, под названием <strong><a href="http://www.moya-planeta.ru/festival_2015/" class="external-link" target="_blank" rel="noreferrer">Планета людей</a></strong>. Первые три дня фестиваля будут посвящены вечерним кинопоказам фильмов о путешествиях, а в завершение <strong>2 августа</strong> будет проведён квест-пикник, в котором сможет поучаствовать каждый желающий. Помимо викторин, игр и уроков танцев будет также организована зона мастерских, в рамках которой прицеп-мастерская <strong>OOLEY42</strong> на целый день станет центром творчества и подготовки к путешествию. Команда OOLEY покажет и расскажет, как делается набивная ткань и предоставит возможность <strong>самостоятельно сшить</strong> себе свою сумку для путешествий, пройдя все этапы от изготовления штампа из дерева до вырезания выкройки из ткани и шитья.</p><p>Также на базе мастерской OOLEY42 будут представлены <a href="http://www.skillpad.ru" class="external-link" target="_blank" rel="noreferrer">грамотные блокноты <strong>SKILLPAD</strong></a>, отлично подходящие для ведения заметок и зарисовок в путешествиях. Посетители фестиваля смогут не только <strong>приобрести</strong> готовые блокноты форматов А4 и А5, но и <strong>самостоятельно собрать</strong> себе блокнот из различной бумаги, а также дополнить его различными полезными памятками, прикрепить резинку или сшить чехол.</p>',2),s=[o];function l(i,c,p,_,d,g){return a(),t("div",null,s)}const k=e(r,[["render",l]]);export{u as __pageData,k as default};
